import React, { Fragment } from "react";
import { Todo } from "./Todo";
import {
  TodoListSection,
  TodoHeader,
  ListTitle,
  OtherBtn,
  ListUl,
} from "../Style/ComponentStyle/TodoStyle";

export const TodoList = () => {
  return (
    <Fragment>
      <TodoListSection>
        <TodoHeader>
          <ListTitle>공부</ListTitle>
          <OtherBtn src="img/Other_btn.svg" />
        </TodoHeader>
        <ListUl>
          <Todo></Todo>
        </ListUl>
      </TodoListSection>
    </Fragment>
  );
};
